import React, { Component } from 'react';

class WishMessage extends Component{
  constructor(props){
      super(props);
      this.state ={
          message:'Hello.'
       }
  }

    SayGoodMorning = () =>{
        this.setState({message : 'Good Morning'})
    };

    render(){
        return(
            <div className="card">
                <div className="card-body">
                    <h1>{this.state.message}</h1>
                    <button className ="btn btn-primary" onClick={this.SayGoodMorning}>Click Me</button>
                    <button className ="btn btn-success" onClick={this.SayGoodMorning}>Click Me</button>
                    <button className ="btn btn-warning" onClick={this.SayGoodMorning}>Click Me</button>
                </div>

            </div>


        );
    }



}

export default WishMessage;
